define(['es6-collections'],function(){'use strict';function Storage(){this.data=new Map();}
Storage.prototype={constructor:Storage,get:function(elems){var data=this.data;elems=elems||[];return elems.map(function(elem){return data.get(elem);});},set:function(elem,value){var data=this.data;data.set(elem,value);return this;},remove:function(elems){var data=this.data;elems.forEach(function(elem){data.delete(elem);});return this;},has:function(elems){var data=this.data;return elems.every(function(elem){return data.has(elem);});}};return Storage;});